('node', 'page', 0, 4, 4, 'und', 0, '<p>In the midst of all the turmoil that unfolded in 2014, there have been stories of despair and uncertainty turn into stories of hope and salvation. &nbsp;Ministry partners are needed throughout the country to assist in Bible camps, medical clinics, construction and a host of other possibilities. &nbsp;Join us in helping Multiply: Ukraine.</p>', '', 'full_html'),
