(77, 'node', ' lviv lviv a city in western ukraine is regarded as one of the main cultural centers of ukraine in 2009 it has been recognized as the cultural capital of ukraine on the 28th of april 2009 lviv has been recognized as the cultural capital of ukraine this status award was given based on expert research of the state service of tourism and resorts and the council on tourism and resorts issues the main reasons of such obtaining is the conducting of more than 100 festivals annually 60 museums 100 churches of different confessions and the big tourist interest in lviv for the past 2 years the tourist stream to the city increased by 40 and now it is more than a million people per year among the foreigners the biggest amount of tourists come from poland germany austria belarus usa and russia the city is known as a center of art literature music and theatre nowadays the indisputable evidences of the city cultural richness is a big number of theaters concert halls creative unions and also high number of many artistic activities temples frescos paintings traditions feasts festivals all these are the heirdom of the past and the product of the present geniuses which can be felt only in lviv due to the rich cultural programme developed infrastructure now lviv has more than 8  hotel rooms over 700 caffees and restaurants free wifi zones in the city centery good connection with many countries of the world lviv has the biggest tourist potential in ukraine lviv is also a huge educational center with 23 educational institutions 7 of which prepares support staff for tourism infrastructure according to the statics more than 10 thousand tourists come to each city festival lviv has established many cityfeasts such as coffee and chocolate feasts the feast of pampukh the day of batyar such festivals as ethnovyr krayina mriy international theatrical festival golden lion lviv is the city where festivals and concerts are being held every week geolocation is 49839683 24029717000000005  ', 0),
(78, 'node', ' odessa odesa is a very special city since it s foundation it was always the mixture of the lot of nationalities for example at the present more than 1000000 people represent 135 nations from all around the world such a mixture was the reason that made this city became very cosmopolitan where each guest is always welcome and people are friendly and simple there are also very undertaking and businesslike creative and practical the fact that odessa is located at the black sea shores made it very attractive as the vacation place still since its foundation at 1794 the sea port is located at the central part of the city but aside of the port there is a long line of beaches that length at its both sides to the end of this big city since a lot of guests traditionally were coming to this city for vacation odesa developed a huge tourist infrastructure restaurants discos night clubs hotels theaters etc where all these people stay when they come to odesa since soviet times odesa had a few hotels of the questionable quality and services however since 1991 when ukraine started the new way of life things has been changed dramatically new big and small hotels of different classes were built as well as private apartments rent business developed extensively odesa is not only an ideal place to rest but it is also a city rich in natural and cultural resources the best way to familiarize oneself with odesa s splendid architecture breathtaking views and fantastic monuments is by walking around its historic center odesa is a city that is not easily forgotten its snowwhite yachts golden beaches lush green gardens and the bluest waters cling to the heart and fill each visitor with an overwhelming desire to return to the beautiful odesa geolocation is 46482526 30723309500000028  ', 0),
(79, 'node', ' kharkiv the history of kharkiv city has almost 360 years and you can t say it s not enough rumor has it city started from phenomena of wild field or dike pole where nomads lived for long time before catherine ii ordered to found the city of kharkiv there are few variants of the city name origin one of it says kharkiv was named on behalf cossack kharko and his monument is standing on lenin avenue one of the main streets the other one is more reliable and says the city was named for the river the name was given by tatar tribes and really the name of river kharkiv found on maps of the russian empire long before the founding of the city a lot of water has flow under the bridge and kharkiv has grown to second biggest city in ukraine and even for few years it was the first capital of ukrainian soviet republic today it is a very special place beautiful in its own way it is also known as cradle of architectural style constructionism and it s monumental grey buildings set the rhythm to central streets thus the city is not grey it has variety of thousand shades and colors creating a unique image kharkiv is a city of youth because here is the largest concentration of educational institutions 69 universities institutes academies and colleges where more than 200000 students are studying they are giving huge positive vibes of energy and emotions and thanks to it our city is growing and moving faster and faster there are thre points to must visit the fisrt one  pokrovsky monastery  was founded right after the city on its territory you can visit pokrovska and ozeryanska church and few associated buildings bishop s house monk s cells icon shop and little bakery with monastery goods nb women should wear skirts and cover the head with some cloth can be taken in monastery security men shouldn t wear shorts the second one  svobody square  is one of the biggest squares in europe and definitely the biggest in ukraine was founded in 1923 few moments before start of constructing the main symbol of kharkiv the gosprom of derzhprom building today the place is never empty city celebrations and concerts fairs and markets children playgrounds in summer to feel the spirit of central point of the city is best while there s something going on it would it be a victory parade on 9 th of may or show of queen which gathered in one place more than 350 thousand people and it was a record number for the group and the third one  architect s square  is situated alongside pushkinskaia street next to architectora beketova station and here there are a few focuses of attention one of them without any doubts is collection of seven wonders of kharkiv miniature copies of kharkiv s outstanding buildings and monuments here are also the fountain of lovers and an oak which is growing here for two hundred years geolocation is 499935 36230383000000074  ', 0),
(80, 'node', ' dnipropetrovsk dnipropetrovsk is spread across both banks of the great dnieper river and is one the most colorful and interesting cities of eastern ukrainian in addition to being the largest industrial and economic center it has the status of being ukraine s space capital and it is an extremely charming city attracting visitors with its beautiful architecture numerous parks picturesque boardwalks and precious historical memorials dnepropetrovsk s history began in 1776 when catherine the great on a trip through the region ordered general gregory potiomkin to establish a city here however the city s construction did not begin until 1787 the building of the transfiguration cathedral started at the same time when the empress herself set the first stone in the structure s foundation the town originally named yekaterinoslav was intended to become russian empire s third main city but these plans were not to be after catherine the great died the city s construction and development slowed down considerably the city s fortunes changed only in the late 19th century when yekaterinoslav prospered as large ores deposits were discovered and a railroad was built nearby soon it became one of the russian empire s most important industrial centers in 1926 yekaterinoslav was renamed into dnepropetrovsk its new name was a combination of the dnieper river and the name of the soviet official grigory petrovsky modern dnipropetrovsk easily weaves together the rhythm of a fastpaced business center with the peaceful atmosphere of countless parks in which local residents like to spend their time but the most popular place to walk and rest is the beautiful lenin boardwalk which happens to be the longest in europe it leads to most one of the most interesting of the city s landmarks the legendary monastyrsky island it is well established that in the 9th century a byzantine monastery stood here which explains the island s name at that time a famous trade route between the varangians and the greeks passed through the dnieper river and the island was often used as a stopping point the old russian princess olga once waited for a storm to pass in a local monastery and shortly after that the prince vladimir the great rested within its walls today monastyrsky islandis part of the largest park of dnipropetrovsk shevchenko park in the park is a cableway from which you can get amazing views of the city and the splendid st nickolay church the park is so splendid that even the pedestrian bridge leading to the island is considered to be a landmark of its own dnipropetrovsk main road the karl marx avenue beckons visitors with its beautiful structures that have survived since the 19th century among them the most notable are the buildings of the national university the city duma parliament and the english club as well as the famous history museum one of the oldest in ukraine it is famous all over ukraine for its impressive collection of antiquities and artifacts which number over seven thousand in the museum a diorama called battle of dnieper which recounts the events of world war ii will attract your attention as will the collection of ancient stone sculptures one of the largest and most impressive in the world the age of some of sculptures goes back up to five thousand years the architectural pride of dnipropetrovsk is rightly considered to be the transfiguration cathedral the same one that has been there since the beginning of the city s history the architect wanted for dnepropetrovsk s church to exceed rome s st peter s cathedral in size even though the idea was not fulfilled the transfiguration cathedral is still an incredible sight to see due to its stern splendor and understated beauty today it is not only one of the most breathtaking cultural buildings in the city but is also its spiritual center dnipropetrovsk attracts with its great harmony two centuriesold classical buildings stand comfortably next to modern high tech buildings and the severity of industrial giants is subdued by the rich greenery of picturesque parks and boulevards all of that along with a unique historical and cultural heritage creates an inimitable atmosphere that makes dnipropetrovsk unlike any other city in the country and attracts thousands of travelers from all over the world geolocation is 48464717 3504618299999993  ', 0),
(81, 'node', ' kyiv kiev is the capital of ukraine with population of about 3 million citizens it is situated on the dnepr river and boasts architectural monuments that are recognized world treasures kiev is the largest cultural scientific and industrial center of ukraine the place of religious pilgrimage and a very attractive tourist destination its beautiful landscapes parks and gardens charm and captivate hospitable ukrainians will be delighted to introduce slavic culture to their foreign guests  kiev is a city of invaluable historical and cultural monuments a city of great events and outstanding people everyone will find there something especially interesting for himself the art and architecture of kiev are considered world treasures many famous artists poets and writers estimated the unique beauty of this city the most renowned landmarks include cathedral of st sophia with outstanding mosaics and frescoes dating back to the 11th century kievopercherskaya lavra featuring several monasteries and cathedrals golden gate of kiev which date back to 1037 ukrainian baroque church of st andrew the magnificent 19thcentury cathedral of st vladimir and many other attractions kiev is often referred to as the mother of all cities by russians and ukrainians it is one of the oldest towns in europe in the historical center of kiev you can feel the spirit of the past everywhere kiev is distinguished for its rich cultural life theater lovers will find many theatres offering various theatrical programs most performances are held in ukrainian or russian the recently renovated kiev opera house presents very good opera as well as a broad repertoire of ballets ivan franko theater is a center of ukrainian drama comedy and musicals a lot of various exhibitions are carried out in the city s numerous museums and art galleries kiev is also a scientific and educational center of independent ukraine various universities and science academies including famous kievmogilyanskaya academy which is one of the first scientific establishments in eastern europe are located there being the largest city of ukraine kiev is a leading industrial and commercial center of the country kiev s major industries include food processing especially processing of beet sugar metallurgy manufacture of machinery machine tools rolling stock chemicals building materials and textiles the development of ukrainian economy gave impulse to business activity of the city there are a lot of new office centers banks trade exhibition centers and other commercial enterprises appearing in the city nowadays take a walk through the ancient streets of this scenic city feel its unique beauty and the spirit of its past for sure your stay in kiev will become one of your most memorable experiences geolocation is 504501 30523400000000038  ', 0),
(82, 'node', ' bible schools bible school activities have been used in various regions to teach children and teenagers the word of god whether it is inside a comfortable building or simply sitting on a tarp on the ground children have been encouraged and taught about jesus  ', 0),
(83, 'node', ' construction teams constructions teams partner with a group or existing body of believers to build a new hall or make renovations usually us partners help supply manpower and materials for the project new construction creates excitement not only for the body but for the community as well  ', 0),
(84, 'node', ' good news several unreached people groups in ukraine are being told about the good news for the first time imb personnel are working among some of the hardest to reach and unloved people in all of europe in these cities imb missionaries are partnering with locals in order to reach them  ', 0),
(85, 'node', ' medical clinic us medical teams have been used throughout ukraine with great success in the sheer numbers reached clinics are set up in existing churches or rented halls every person seen in the clinic is prayed for clearly given the good news and sent home with a new testament if they don t have one typically a clinic sees more than 75 people a day  ', 0),
(86, 'node', ' ministry throughout ukraine imb missionaries are involved in a variety of ministries throughout ukraine the main task is to support the work of partners and the ministries entrusted to them these include starting small groups in existing churches and as an impetus to starting new churches disciple making through training for trainers experiencing god and other resources training and evangelism imb missionaries are always looking for us partners to join in ministry opportunities in order to strengthen the local church or group here are just a few of the many ministries a us partner church could join in the harvest fields of ukraine  ', 0),
(87, 'node', ' history for 300 years ukraine had been the part of russian empire and the soviet union of socialist republics during the russian empire times most people who lived in ukraine were serfs and worked hard for food it was actually slavary at this time taras shevchenko famous ukrainian poet and writer of that period described all the horrors in his poems and encouraged people to fight against the existing regime till he was referred to hard labor since 1919 ukraine joined the ussr because the territory of ukraine was strategically important with all available raw materials there were rich deposits of coal iron and ore in the east and fertile soil almost in all the regions except the south plants and factories were built in the east for manufacturing of these resources kolkhoz collective farms were built on other territories for growing cattle to provide food for other parts of the soviet union people from other republics often moved to the eastern part of ukraine due to the possibility to get a job on plants and factories therefore most inhabitants of the east have many relatives in russian federation and have better memories about the ussr times instead inhabitants of other parts of ukraine worked in farms and didn t have such salaries as people who worked in plants better paid for work in the plant in addition due to the collectivization policy farms were taken away from farmers and those farms were combined into collective farms it was a forced process those who opposed to the collectivization were resettled in siberia and most of them died on the way perhaps 5 million people were sent to forced labor camps also soviet leadership used the manmade famine to attack ukrainian nationalism during the soviet union times national interests and culture of ukrainians was under a serious pressure unquestioning faith in the soviet leaders was implanted in people from their childhood vladimir lenin josef stalin the ukrainian dissidents were persecuted ukrainian language and religion was under a prohibition and indignity that is why ukrainian literature is closely related to the idea of national consciousness and the struggle for independency a lot of literature and government figures were shot sent to prison by the communist party because they had written the truth about actual life in the country in the soviet union above 40 mln people were depositors of the sberbank national bank of the ussr when the soviet union collapsed in 1991 its national currency was depreciated and a lot of people were left with nothing many people became millionaires but in fact they could not buy anything because prices were up by 24 times and there was a terrible shortage of goods however some people still want to go back to the ussr time of parades no crimes time of their youth density of population was comparably high in the east and in the south of ukraine they believed that social isolation had deprived them of such negative social phenomena as absence of crime drug abuse and prostitution inhabitants of the ussr traveled only in the soviet union and could not see any exampes of people s lives abroad and they easily believed they lived very well until the soviet union collapsed ukraine gained its independence on august 24 1991 after the socalled iron curtain fell in 1991 the inhabitants of the ussr were able to see the trueth that in some countries people were living much better and in some much worse people got the opportunity to travel abroad but hardly anybody could afford it for a long time russian culture had been a part of the ukrainian culture that is why cultural traditions and language of these countries are very similar before the soviet union collapsed the hospitality of the people was much better than nowadays because almost everybody stood on the same social level there was a socalled equalization people believed in a bright future and worked with such an idea after the collapsion the country crisis and unemployment was flourishing the level of crime increased people had came to understanding that someone s lives was much better than theirs this situation led to occuring such negative feelings as greed envy a sense of inferiority even now poorer people envy richer because they believe that rich people have gained their wealth by a dishonest way poor people do not want to do something in order to live better they blame state and the politicians though there might be some reasons or other people in their failures in 2013 ukraine took the 5th place in the number of alcoholics in the world after moldova hungary czech republic and russia you can often hear on holidays men cheering and saying if you will not drink with me then you don t respect me the population got accustomed to drinking rather than facing and fighting against their problems in ukraine people don t go to psychologists they meet up with friends to complain to their affairs with a bottle of drink sometimes you can see a man who fell and sleeps in the street and no one rushes to help him most of people in ukraine will think that man is just very drunk there is ukrainian saying my house is at the end whcih would be an equivalent to none of my business and it means that a person who does not care about the problems of others the strongest desire of ukrainians is to have more money than the neighbor has of course this is a joke but with a high degree of truth in it in ukraine it is a normal thing to ask for money in debt from relatives friends neighbors since 1990s many ukrainians have gone abroad in search of a work but they are forced to work in hard working conditions because they don t know the language and have no rights in a foreign country ukrainians have been working on farms or taking care of elderly people or cleaning up houses they returned to ukraine with money but with acquired diseases and really exhausted in their absence a wife husband would find another family kids would be distanced from the parents and families broke down most ukrainian can t get a good education healthcare and housing students have to buy textbooks themselves in many schools because the state does not provide schools properly teacher isn t a prestigious profession in this country it is very difficult to buy a house or appratment that is why most ukrainians have to rent it health insurance is absent and some doctors can refuse a patient in a provision of medical aid if there is no cash payment a bribe of course it s illegal but people have to pay because they cannot afford to defend their rights in a court if a person is suffering from cancer or other hard diseases and he needs a lot of money for a surgery this person would have two options how to get money either to ask for financial help from a family friends strangers through the media to beg in the streets or die having survived two world wars famine constant harassment from the russian empire and the communist party our ancestry passed on true stories about their lives at those times probably it is a wonderful reason for the older generations to spend more time with younger generations religion and language harassment have led to the loss of patriotic behaviors in ukrainians although in recent years ukrainian patriotism has been reborn in people s minds and behaviours moreover the presence of volunteers who are willing to defend ukraine in the east proves the restoration of the patriotism performing of ukrainian hymn in schools and wearing national dresses for the holidays are exapmles of it as well young people have begun to speak ukrainian language although most had spoken russian earlier in the west almost all speak ukrainian in the center and north both ukrainian and russian in the east and south russian 1 uah vladimir the great grand prince of kiev first started christianity in kievan rus 2 uah yaroslav the wise kyiv prince 5 uah bogdan khmelnitsky public and politician head of the cossack state 10 uah ivan mazepa public and politician head of the cossack state 20 uah ivan franco writer poet social and political activist 50 uah mykhailo hrushevsky politician 100 uah taras shevchenko poet writer painter social and political activist 200 uah lesya ukrainka writer and cultural figure 500 uah hryhorii skovoroda philosopher educator poet  ', 1428707657),
(88, 'node', ' learn about ukrainian food ukrainians are very hospitable people that is why they are always trying to feed guests villagers are more hospitable you can hurt a master of a home if being his guest you refuse from a proposed food this might be viewed as arrogance it s also desirable to finish all food on your plate so don t take more food that you can finish afterwards better to take smaller pieces of a dish and if you enjoy the taste you can take more later traditional ukrainian dishes are borscht varenyky golubtsy holodets and salo borscht is a soup made with beets haricot bean meat potato cabbage onion carrot tomato varenyky reminds a large dumpling with different fillings such as cabbage potato potato mixed with mushrooms cottage cheese and others golubtsy is made of a cabbage leaf stuffed with grained meat and boiled rice golubtsy must be stewed with tomato and sour cream holodets is a something like cold meat jello it is usually cooked with pork shank salo is made only from pig there are a lot of sayings that salo is one of the main and the most favourite food for ukrainians daily food in a village differs from food in a city village people breed domestic animals so they often cook pork and poultry also all village people have a garden where they usually grow potatoes and other different vegetables people from villages usually cook their meals using the vegetables from their gardens meals are balanced and tasty but can be very nourishing almost all city folks buy their food in supermarkets though some buy in markets fastfood resturants are becoming widespread in the cities and towns but you need to be careful with food that you can buy an a street you might have stomach ache as such food isn t cooked under required sanitary conditions foreign visitors should note that if they go to a market to buy some meat they can always see medieval paintings inside of a market buildings a pig head ears and hooves it is really fascinating restaurants and caffes offer folks and guests meals of different cuisines ukrainian russian georgian italian european french and japanese other wellknown fast food restaurants such as mcdonalds kf s have already become popular in bigger cities nevertheless city folks still cook at home they usually cook soups cereals salads and meat for breakfasts ukrainians usually drink coffee black or green tea eat a sandwich with cheese and sausage or eggs but 60 of ukrainians don t often have breakfast these kind of food is grown in ukraine and used to make dishes vegetables potatoes onions carrots cabbage tomato cucumber celery zucchini pumpkin meat pork chicken beef fish carp crucian carp tench bream and catfish most part of ukraine has not access to any seas that is why dishes contained seafood aren t popular cereals and legumes wheat rye oats corn peas beans buckwheat fruits and berries apples pears plums apricots cherries sweet cherries strawberries raspberries watermelon and grapes herbs and spices fennel parsley black pepper and basil alcoholic beverages beer vodka wine vodka is a very strong alcoholic drink 40 made of cereals and alcohol so it should be drunk with caution vodka analog has been made in some villages and called samogon moonshine it can be even stronger than vodka and have taste of the product prepared from beets potatoes sugar the word samogon comes from two words samo by himself and gon abbriviation from word that means the way to get alcohol from sugar or other products word samogon means done independently time for alcohol selling is limited from 800 to 2200 in ukraine alcohol and tobacco aren t allowed to sell to persons under 18 but some are violating these rules of law still ukrainian sugar is made from sweet beet and oil is made from sunflower the tap water in the cities is not recommended to use because it is process water and is harmful to health better to order water in companies that produce it alaska etc or buy in the supermarket ukrainian sayings and expressions that are concerned with food bread is the head for everyhting this expression is associated with fact that ukrainians have deep respect for bread since ancient times most people in ukraine will not eat a main dish without bread this attitude towards bread is caused by the famine years that happened not once in the history of ukraine neither fish nor fowl this expression describes a person who is not sure in his opinion or decisions bathing like curd in butter to live in clover means that person lives in luxury his life is just abundant lick your paw means a person didn t get what he expected to get fail in something it indicates a situation when you want something and don t get it so you just have to lick one s lips apple doesn t fall far from the apple tree means that children are repeating shortcomings of their parents and most of the times children remind their parents in actions and decisions i ate dog this means that person is very experienced in something or very educated in a aprticular subject if i don t fully eat it then i ll bite off it means person don t want to share with anyone person can t take all but he doesn t want to share it neither  ', 1428709025),
(89, 'node', ' my love affair with ukraine dropetrovsk ukraine my love affair with ukraine started more than 20 years ago god first called me to the former soviet union in 1992 and i moved to lugansk ukraine in february 1994 imb missionary tom long has lived in and out of ukraine for 20 years with much of the last four years in donetsk the recent unrest has caused him to relocate to dnepropetrovsk please join him in praying for donetsk and ukraine read more youreports in those early years i saw lots of growth numerically in believers and church starts sure there were difficulties like standing in line to purchase bread however seeing people who lived under communism for 70 years stepping forward to live in christ was worth every hardship encountered after three years i returned to the us to attend seminary and eventually went back to ukraine in september 2003 with the international mission board life had dramatically changed in the six years i was gone unfortunately church growth was slowing in the midst of prosperity four years ago i moved to donetsk in the heart of the industrial belt trying to plant churches in eastern ukraine had always been difficult but god blessed me with a group of young people who had the same desire last fall we moved into a rented hall and were averaging 20 people in the worship service we made plans to start new groups but in february 2014 ukraine s president left office his departure set off a series of events that turned our world upside down and led me to leave donetsk in april war came to the city in late may and dispersed the church members to russia and all over ukraine by midjune i knew i would not be returning to donetsk i would go to dnepropetrovsk instead it would be my fifth move in 11 years a move i really didn t want to make yet a move i knew i had to make since i left donetsk god has been teaching me much about loving him with all my heart soul mind and strength and loving my neighbor as myself what does it mean to love my neighbors surely god doesn t mean those neighbors who caused me to flee my apartment my life the city i loved or does being a christ follower mean i must love even those neighbors i ve seen examples of several pastors loving these neighbors in the conflict zone one brother shared with me that during the height of the war their church housed more than 70 people and fed many more this pastor could be retired yet he stayed and served others he told me he couldn t leave it was his duty to stay because the church s doors have been open they have seen numerous people from the neighborhood repent a second pastor and his family have stayed right in the midst of the war their church serves food to their neighbors he drives outside the conflict zone so he can get money and food his family along with a few church members who stayed behind prepares the meals for those who don t have any resources for purchasing food through this ministry the church has seen people more interested in hearing the gospel and some have put their faith in jesus another pastor recently challenged me to pray a list of scriptures back to the lord and to substitute my name for the pronouns so as i sat in the park on a beautiful saturday afternoon i prayed john 1334 a new commandment you gave to tom that tom loves one another just as you have loved tom tom also is to love one another a clear picture came to me of what the lord intended in this verse it doesn t matter where i live whether in texas donetsk or dnepropetrovsk if i am going to be his disciple i must love  ', 0);
